void printSTLogo(SSD1306Driver *devp){
  /* ST LOGO base image */
  int x = 0;
  int y = 0;
  int c = 0;
  for(y = 0; y<SSD1306_HEIGHT; y++){
    for(x = 0; x<SSD1306_WIDTH; x++){
      ssd1306DrawPixel(devp, x , y, images[0][c]);
      c++;
    }
    ssd1306UpdateScreen(devp);
  }
  ssd1306UpdateScreen(devp);
}


void printAlertMsg(SSD1306Driver *devp){

  int x = 0;
  int y = 0;
  int c = 0;
  for(y = 0; y<SSD1306_HEIGHT; y++){
    for(x = 0; x<SSD1306_WIDTH; x++){
      ssd1306DrawPixel(devp, x , y, image_alert[c]);
      c++;
    }
    ssd1306UpdateScreen(devp);
  }
  ssd1306UpdateScreen(devp);
}




